%  LQR_1
%这里先从简单开始，给定一个直线车道和车辆位置偏差。
%参考轨迹的生成方法有两种：
%1.车辆在Path上投影，然后在PATH上选取一系列的点作参考点
%*现在遇到的问题是Q R的参数怎么设置。而且通用性怎么办？*%

clear all;
close all;
clc;
%% 给定参数：

vel = 6; % 纵向车速,单位：m/s
L=1.85;%轴距
T=0.02;% sample time， control period
% 给定圆形参考轨迹
 CEN=[0,0];       % 圆心
 Radius=20;       % 半径

%% 设置参数
Hp =10;%predictive horizion, control horizon 
N_l=800;% 设置迭代次数

Nx=3;%状态变量参数的个数
Nu=1;%控制变量参数的个数

FWA=zeros(N_l,1);%前轮偏角
FWA(1,1)= 0; %初始状态的前轮偏角

x_real=zeros(Nx,N_l);%实际状态
%x_real(:,1)= [18940 41975 5.5]; %x0=车辆初始状态X_init初始状态
x_real(:,1)= [18940 42005 3]';
%x_real(:,1)= [18960 42005 3];
%x_real(:,1)= [22 0 pi/2];
% x_piao=zeros(N_l,Nx);%实际状态与参考轨迹的误差
% 
% u_real=zeros(N_l,Nu);%实际的控制量
% u_piao=zeros(N_l,Nu);%实际控制量与参考控制量的误差

% X_PIAO=zeros(N_l,3*Hp);%通过DR估计的状态
% 
% XXX=zeros(N_l,3*Hp);%用于保持每个时刻预测的所有状态值


Delta_x = zeros(3,1);

Q=[10 0 0; 0 10 0; 0 0 100];
R=[1000];%r是对控制量误差的weighting matrice

Pk=[1 0 0; 0 1 0; 0 0 1]; %人为给定,相当于QN
Vk=[0 0 0]'; %人为给定,相当于QN

%%  算法实现
 u_feedBackward=0;
 u_feedForward=0;
 
