rec1_04120934.Y(3).Data = rec1_04120934.Y(3).Data(175:4265);
rec1_04120934.Y(2).Data = rec1_04120934.Y(2).Data(175:4265);
rec1_04120934.Y(5).Data = rec1_04120934.Y(5).Data(175:4265);
 %*首先生成参考轨迹，画出图来作参考*%
