 RefTraj_delta = rec1_04120934.Y(5).Data'./18/180*pi;
 RefTraj_Length = zeros(length(RefTraj_x),1);
 for i = 2:length(RefTraj_x)
    RefTraj_Length(i) = RefTraj_Length(i-1) +  norm([RefTraj_x(i) RefTraj_y(i)]-[RefTraj_x(i-1) RefTraj_y(i-1)]);
 end
    
